import React from "react";

function SignUpDetails() {
  return (
    <div
      style={{
        height: "100%",
        width: "100%",
        backgroundColor: "skyblue",
        display: "flex",
      }}
    >
      <div style={{ height: "100%", width: "45%", backgroundColor: "pink",textAlign:"right" }}>
        <p style={{height}}>Name</p>
        <p>Email</p>
        <p>Password</p>
        <p>Confirm Password</p>
      </div>
      <div style={{ height: "100%", width: "55%" }}>
        <p>Name</p>
        <p>Email</p>
        <p>Password</p>
        <p>Confirm Password</p>
      </div>
    </div>
  );
}

export default SignUpDetails;
